import React from 'react'
import SectionCottages from './section/SectionCottages'
import SectionMain from './section/SectionMain'

const Main = () => {
  return (
    <main className='page'>
        <SectionMain/>
        <SectionCottages/>
    </main>
  )
}

export default Main
